# training parameters
train:
  max_epochs: 300
  max_lr: 0.2            # sgd learning rate max
  min_lr: 0.05           # warmup initial learning rate
  up_epochs: 0.1         # warmup during first XX epochs (can be float)
  down_epochs:  7        # warmdown during second XX epochs  (can be float)
  max_momentum: 0.9      # sgd momentum max when lr is mim
  min_momentum: 0.85     # sgd momentum min when lr is max
  final_decay: 0.95      # learning rate decay per epoch after initial cycle (from min lr)
  w_decay: 0.00001       # weight decay
  batch_size: 128        # batch size
  report_batch: 1        # every x batches, report loss
  save_summary: False    # Summary of weight histograms for tensorboard
  avg_N: 3               # average the N best models

# backbone parameters
backbone:
  name: "darknet"
  dropout: 0.0
  bn_d: 0.05
  OS: 32 # output stride
  train: True # train backbone?
  extra:
    darknet: "darknet53"

# classification head parameters
head:
  name: "classification"
  dropout: 0.05

# dataset (to find parser)
dataset:
  name: "imagenet"
  location: "/cache/datasets/imagenet"
  workers: 12 # number of threads to get data
  img_means: #rgb
    - 0.485
    - 0.456
    - 0.406
  img_stds: #rgb
    - 0.229
    - 0.224
    - 0.225
  img_prop:
    width: 256
    height: 256
    depth: 3
